         Q_local_tmp = memdata;
        end // if RSCRST
      end // if of ADRlatched <= 10'b1111111111
    end // if of WElatched = 0
  end //if of flaga_adr_ok is true and flaga_read_ok is true and flaga_rm_ok is true
  else
  begin
    if (flaga_viol)
    begin
      if ((WElatched === 1'b0))
      begin
        corrupt_q;
